import React from 'react';
import { Link } from 'react-router-dom';
import '../App.css';

function Navbar() {
  return (
    <nav className="navbar">
      <ul className="navbar-list">
        <li className="navbar-item"><Link to="/" className="navbar-link">Home</Link></li>
        <li className="navbar-item"><Link to="/mentors" className="navbar-link">Mentors</Link></li>
        <li className="navbar-item"><Link to="/students" className="navbar-link">Students</Link></li>
        <li className="navbar-item"><Link to="/assign-mentors" className="navbar-link">Assign / Change Mentors</Link></li>
        
      </ul>
    </nav>
  );
}

export default Navbar;
